import { Component } from '@angular/core';
import { DomSanitizer, SafeResourceUrl } from '@angular/platform-browser';
import { Video } from 'src/app/classes/video';
import { ExercisesValueService } from 'src/app/services/exercises-value.service';
@Component({
  selector: 'app-video',
  templateUrl: './video.component.html',
  styleUrls: ['./video.component.css']
})
export class VideoComponent {

  videourl: string = '';
  name = 'Angular 6';
  safeSrc: SafeResourceUrl;
  videoobject!: string;

  ngOnInit(): void {
    this.getUrlValue();      
  }

  constructor(private sanitizer: DomSanitizer,
              private exercises: ExercisesValueService) { 
    this.safeSrc =  this.sanitizer.bypassSecurityTrustResourceUrl(this.videourl);

}

getUrlValue(){
  this.exercises.VideoValue.subscribe(data=>
    this.videoobject = data);
      this.videourl = this.videoobject;
  }
}
